func main() {
    pc, err := net.ListenUDP("udp", &net.UDPAddr{Port: 53})
    if err != nil {
        log.Fatal(err)
    }
    defer pc.Close()

    handler := dns.HandlerFunc(func(w dns.ResponseWriter, r *dns.Msg) {
        msg := dns.Msg{}
        msg.RecursionDesired = true
        msg.Id = r.Id
        msg.Qdcount = r.Qdcount
        msg.Ancount = 0
        msg.Nscount = 0
        msg.Arcount = 0

        for _, q := range r.Question {
            msg.Question = append(msg.Question, dns.Question{Name: q.Name, Qtype: q.Qtype, Qclass: q.Qclass})
        }

        in, err := dns.Exchange(&msg, "8.8.8.8:53")
        if err != nil {
            log.Printf("Error forwarding request: %v", err)
            return
        }

        for _, a := range in.Answer {
            w.WriteMsg(in)
        }
    })

    server := &dns.Server{Addr: ":53", Net: "udp", Handler: handler}
    log.Fatal(server.ListenAndServe())
}
